53	Website and Android App for School After class 	Imjack1	/projects/255	Project Name\nTechnikTeam - Event & Crew Management System\n\nElevator Pitch\nI replaced my school A/V club's chaotic spreadsheets and group chats with a full-stack web app that manages everything: event scheduling, crew assignments, and a QR-code-powered gear inventory.\n\nDetailed Description\nOur school's event tech crew was a mess. To fix it, I built TechnikTeam, a custom web platform that acts as the single source of truth for all our operations. It's a full-stack Java application designed to bring order and professionalism to our student-run events.\n\n🚀 Core Features:\n\nEvent Scheduling & Crewing: Plan events, define roles (like "sound tech"), and assign crew members based on their skills.\nLive Event Dashboard: During a show, assigned members get a real-time dashboard with a group chat and a shared task list to stay in sync.\nQR-Powered Inventory: Catalog all our gear. Anyone can scan a QR code on a piece of equipment to see what it is and where it belongs, and crew members can check items in or out.\nInteractive Skills Matrix: A huge grid that visually tracks which crew members are trained on which equipment, making it easy to find the right person for the job.\nRole-Based Access: A full admin panel for leaders and a streamlined view for student crew members.\nTech Stack\nJava (Servlets/JSP), MySQL, JavaScript, HTML/CSS, Apache Tomcat.\n\nWhat I Learned\nFull-Stack Development: I built the entire system myself, from designing the relational database schema in MySQL to coding the backend logic in Java and building the dynamic frontend with JSP and JavaScript.\nSolving a Real Problem: This wasn't a tutorial. I had to talk to my crew, understand their pain points, and design features that actually made their lives easier.\nComplex Systems Design: I learned how to architect interconnected features, like making the inventory reservations appear on the event pages and building the complex data queries needed for the interactive skills matrix.	2901	20	/rails/active_storage/blobs/redirect/eyJfcmFpbHMiOnsiZGF0YSI6MTU1NzgsInB1ciI6ImJsb2JfaWQifX0=--bdb52e44dee719e56d3ea873e8c16ce50dc87ede/Screenshot%202025-07-04%20at%2000-02-02%20-%20TechnikTeam.png	Web App	2025-07-10 11:26:02.706		2025-06-16 20:22:16.243	2025-06-24 06:34:32.934		https://github.com/Imjack1-cyber/TechnikTeam	U091MUWD64V	2025-07-10 11:52:27.539
