491	LumosLearn	Manthan Jindal	/projects/5264	LumosLearn started with a simple but powerful idea: education should be equal, no matter where you're born or what resources you have. Growing up, I realized that while some students have access to amazing teachers, digital tools, and support systems — millions of others don’t. Especially in rural or underserved communities, learning often stops because of things completely out of a student’s control. I couldn’t ignore that.\n\nThat’s when I decided to work on LumosLearn — not just as another tech project, but as a mission-driven effort to reimagine what learning could look like for everyone. The goal is to make sure that no student is left behind because of geography, income, or lack of infrastructure. I believe every learner deserves a chance to reach their full potential, and that belief is at the core of everything I’ve built.\n\nLumosLearn is all about creating fair and inclusive learning opportunities — whether it’s through personalized content, adaptive support, or simply making education feel more human and approachable. It's not about replacing teachers or schools. It's about supporting students who’ve been left out for too long and giving them the tools they need to rise.\n\nThis project is my way of taking a stand for educational equity — of using what I know and what I love (technology, learning, and solving real-world problems) to try and make a meaningful difference.\n\nIf you’re inspired by this idea, I’d really appreciate it if you respected the originality and intent behind it. Please help keep LumosLearn’s mission authentic — not copied, but supported in spirit.	1837	7	/rails/active_storage/blobs/redirect/eyJfcmFpbHMiOnsiZGF0YSI6MTY1MzEsInB1ciI6ImJsb2JfaWQifX0=--09ffb9dff0e303f85d51f84890673f3a77d91305/Screenshot%202025-07-05%20105122.png	Web App	2025-07-10 11:26:02.706	https://lumoslearn.tech/	2025-07-04 09:00:48.636	2025-07-05 05:24:05.163	https://raw.githubusercontent.com/manthanjindal/LumosLearn/refs