3762	Achernar	Ibrahim Shahid	/projects/377	Achernar is a modular, AI-powered astronomy platform designed for real-time imaging, smart guidance, and field reliability—running entirely offline if needed. At its core is the Achernar Daemon, a headless service written in Rust and C++ that runs on edge devices like Raspberry Pi, Jetson, or field laptops. This daemon handles camera interfacing (via V4L2 or ASI SDK), real-time frame capture, debayering, and hardware encoding, with integrated ONNX Runtime or TensorRT for on-device inference. It runs a local REST API (via actix-web or warp) to expose control interfaces.\n\nThe AI layer performs offline inference to suggest focus, exposure, and filter settings based on local environmental conditions, using quantized ONNX models that are confidence-based and never enforced. Imaging sessions are organized in a local-first folder structure, saving FITS files, logs, and preview videos, with append-only JSON logs and optional SQLite used for dashboard caching. When internet becomes available, sessions can be automatically synced to S3, Google Drive, or Dropbox via rclone or custom Rust logic.\n\nUsers interact through either a WebApp PWA, designed with React or SvelteKit + Tailwind CSS, or a Desktop App for advanced control. The WebApp is served from the edge device over a local Wi-Fi hotspot, enabling users to preview live streams (MJPEG or WebRTC), pick targets, and start imaging directly from their phone or tablet. The Desktop App—built using Qt or Tauri—caters to professionals with tools for FITS inspection, focus metric plotting, and full mount control (via INDI or ASCOM). All user sessions are secure, crash-safe, and never rely on cloud services for imaging, making Achernar robust for remote or off-grid astronomy. Cloud sync and remote dashboards activate only post-session, ensuring reliability with WebSockets for control and WebRTC tunnels for live previews, hosted optionally via Next.js or SvelteKit on platforms like Verce