3529	BKFZ SubGHz	Brian Walczak	/projects/1555	Welcome! My project is called BKFZ SubGHz (stands for Brian's Knockoff Flipper Zero, lol), a custom-built ESP32 device that can scan, record, and replay SubGHz radio signals, kind of like a DIY version of the Flipper Zero!\n<br>\nI built this last October after getting curious about how the Flipper Zero works, and wanted to recreate part of its functionality using cheap AliExpress parts. What started as a small side project I worked on when I was free quickly turned into one of the most challenging projects I’ve ever made. \n<br>\nThe project is powered by an ESP32 (a Wi-Fi microcontroller that runs all the code) which serves a web interface you can access from your phone. The microcontroller is connected to a CC1101 transceiver, which is a chip capable of capturing and replaying SubGHz frequencies like 433 MHz (the Flipper Zero uses this exact same chip from Texas Instruments).\n<br>\nThe entire thing is held together by a custom PCB designed in KiCad to keep it small, and it has added support for .sub files from real Flipper Zeros (so it’s compatible with public files from the flipper community). I also added support for preset modulation to match the Flipper Zero's configuration!\n<br>\nFeatures:\n- Frequency Analyzer: Scan and analyze nearby devices and their frequencies with ease.\n- Record RAW: Capture and record nearby signals with precise RSSI configuration.\n- Replay RAW: Replay previously captured signals from a file (no SD card required).\n- Preset Configuration: Configure the frequency of your device, and set the preset modulation (just like the Flipper Zero!).\n- Flipper Zero Support: Effortlessly replay any Flipper Zero SUB file, including the many publicly available ones, whenever you need.\n<br><br>\nThe following parts were used for the project (~$18.01 total, but you can make a minimal USB-powered one for ~$4.98)\n<img src="https://raw.githubusercontent.com/BrianWalczak/BKFZ-SubGHz/refs/heads/main/Other/Assembly%20Photos/Components/All%20Components.jpeg" />	8	1	/rails/active_storage/blobs/redirect/eyJfcmFpbHMiOnsiZGF0YSI6MjA0NiwicHVyIjoiYmxvYl9pZCJ9fQ==--7276779fe4581c24bfa9e4466a96773dcfe628b6/Step%208.%20Final%20Product.jpeg	Something else	2025-07-10 11:26:02.706	https://github.com/BrianWalczak/BKFZ-SubGHz	2025-06-18 22:27:05.593	2025-06-27 05:45:32.221	https://raw.githubusercontent.com/BrianWalczak/BKFZ-SubGHz/main/README.md	https://github.com/BrianWalczak/BKFZ-SubGHz	U091MEESEDT	2025-07-10 11:58:17.79
