1070	KeyLayer	Nadeem Biryani Dealer	/projects/3889	KeyLayer v1.0\n"Turn your spare keyboard into a machine that does things so you don’t have to."\n\nThis is KeyLayer, a low-level macro tool for Windows HID devices. It’s not a key remapper. It’s not a hotkey thing. It’s more like: “What if this random keypad controlled your entire life?”\nBuilt for people who are either extremely efficient or extremely lazy (ideally both). I made this because I got tired of doing the same 6 actions 80 times a day and figured a dedicated macro keyboard deserved a bit more respect.\n\nFeatures (allegedly)\n\nDevice Isolation\nPick any HID keyboard and make it invisible to Windows. Now it only talks to KeyLayer. Like a walkie-talkie but way nerdier.\nVisual Macro Editor\nA drag-and-drop grid thing. You connect boxes. The boxes do things. Like a flowchart, if flowcharts had keypresses and HTTP requests.\nLayers\nMultiple keymaps per device. You can toggle them, hold them, or activate them conditionally. Basically like having 12 keyboards in one, but without the cable mess.\nAction Types\nIt simulates input, launches apps, takes screenshots, clicks stuff, types things, moves the mouse, yells at the OS, and maybe opens a file if you're lucky.\nTemplate System\nSave your macros. Share them. Never open your email with your actual hands again.\nImport/Export\nJSON, XML, AutoHotkey, PowerShell, or some compressed binary thing I half-documented.\nMacro Recorder\nPress record. Do a thing. Watch it get turned into a macro with weird timing values you'll have to clean up later.\nProfiles & Settings\nStored in JSON because YAML made me angry one time. Backup/restore works unless it doesn’t.\nStuff That Technically Works\n\nReal-time HID scanning\nMulti-device support\nLive testing in the macro editor\nNode zoom/pan so you can pretend it’s Blender\nUndo/Redo for when you mess up repeatedly\nTemplated macros with metadata nobody uses\nEncryption (for your deeply private macros)\nExample Use Cases\nGaming: Press one key to press three other keys. Wow.\nProductivity: Insert email templates so you don’t have to pretend to type anymore.\nDevelopment: Make a button that builds and runs your code because clicking things is exhausting.\nQA: Automate testing so your soul can remain intact.\n\nTroubleshooting\nDevice doesn’t show up? Plug it in better.\nIsolation fails? Probably another app being weird.\nNothing works? Try turning it off and on again.\nLaggy? Adjust some obscure buffer setting until it's less laggy.	425	4	/rails/active_storage/blobs/redirect/eyJfcmFpbHMiOnsiZGF0YSI6MTgwMTAsInB1ciI6ImJsb2JfaWQifX0=--c3081c0ae2e28aa7b5cb17d96d71db3dbf6f1d16/image.png	Something else	2025-07-10 11:26:02.706	https://github.com/UltimaCodes/KeyLayer/releases/tag/alphaMain	2025-06-26 10:26:43.684	2025-07-07 13:24:54.805	https://raw.githubusercontent.com/UltimaCodes/KeyLayer/main/README.md	https://github.com/UltimaCodes/KeyLayer	U082WT6L2H2	2025-07-10 11:54:11.212
