1713	chase game 	mandela ferede	/projects/5835	This project is an exciting, fast-paced chase game that puts players in a dynamic arena where quick thinking and sharp reflexes are key. In this game, you either escape from the opponent or chase them down — depending on the mode you choose. It’s built entirely using HTML, CSS, and JavaScript, and designed to give a smooth and interactive experience with both single-player and two-player options. The concept is simple, but the execution brings a level of creativity and detail that makes it stand out.\n\nWhat makes this game special is the set of features it packs into a browser-based experience. First, there are two main game modes: Player vs Computer (PVC) and Player vs Player (PVP). In PVC mode, the AI intelligently chases the player using a real-time pathfinding approach, creating tension as the player tries to survive. The PVP mode, on the other hand, adds a competitive edge where both players control their own characters — one with arrow keys, the other with WASD. This dual-mode setup makes the game replayable and engaging for different audiences.\n\nThe game arena itself is filled with obstacles that are randomly generated in each session. This means that no two matches are exactly alike, encouraging players to adapt their strategy every time. Power-ups appear throughout the arena, and collecting them temporarily increases a player's speed, adding a strategic layer to the chase. There’s also a win condition: in PVC mode, if the player survives for a set time, they win — adding a clear goal beyond just running away. The overall design is polished, with colorful gradients, glowing effects, and responsive layout adjustments that make it look and feel professional on any screen.\n\nThe reason I created this game is because I’ve always been a big fan of chase games and I’m passionate about game development. I want to build big, creative, and enjoyable games in the future, and this project is the beginning of that journey. Rather than diving straight into complex systems, I chose to start with a smaller project that still reflects my ideas and creativity. This Chase Game is a foundation — a first step in a series of projects I’m planning to build and ship as part of my personal learning and creative growth.\n\nMore exciting games are coming soon. Each one will explore new mechanics, stories, and fun ways to play. This is just the beginning, and I’m excited to continue developing games that not only work — but spark joy and imagination in the people who play them.	1823	3	/rails/active_storage/blobs/redirect/eyJfcmFpbHMiOnsiZGF0YSI6MTk2NzcsInB1ciI6ImJsb2JfaWQifX0=--70861744d936854b22be82c9c7481d2046d500d6/Screenshot%202025-07-10%20033405.png	Web App	2025-07-10 11:26:02.706		2025-07-08 15:02:51.32	2025-07-09 21:48:34.627			U092JSPLANT	2025-07-10 11:54:31.984
