1996	Okta Role Mining with OPA-Driven Access Recommendations	Arbind Mishra	/projects/3377	This project automates the process of role mining in Okta by integrating a LangGraph-based agent with GPT-powered group suggestion and Open Policy Agent (OPA) for access validation. The system analyzes user profiles, their current group memberships, and department data to intelligently recommend group assignments. It validates these recommendations against organizational policies enforced by OPA, ensuring compliant and optimized group assignments.\n\nThe solution includes:\n1. A React-based Frontend for user selection and result visualization.\n2. A FastAPI-based Backend to handle agent requests and serve the LangGraph engine.\n3. An Okta API Integration Layer for real-time user and group data retrieval.\n4. An OPA Policy Evaluation Layer to block non-compliant group assignments.\n5. Real-time logs for step-by-step traceability.\nThis project streamlines identity governance, enhances security posture, and provides an interactive interface for role analysis and decision-making.\n\nWrapper Layer: Orchestrating the System\nThe Wrapper Layer acts as the central orchestration engine that connects the frontend, backend, LangGraph agent, Okta APIs, and the OPA policy engine in a seamless flow. It provides a unified API interface that simplifies interactions across these distributed components.\n\nKey functions of the Wrapper Layer:\n1. Data Aggregation:\nCollects user and group information from the Okta API and serves it in a cleaned, frontend-friendly format.\n2. Process Invocation:\nSends user data to the LangGraph agent for group suggestion and orchestrates the complete flow from input selection to final decision.\n3. Response Routing:\nHandles asynchronous processing and real-time log streaming to the frontend, ensuring users can track every step of the decision process live.\n4. Abstraction:\nDecouples the complex backend logic from the React frontend, providing clean and minimal APIs for easy consumption.\n5. Modular Branches:\nSupports independent development and versioning of different components (agent, backend, frontend, OPA) by providing a consistent entry point.	274	2	/rails/active_storage/blobs/redirect/eyJfcmFpbHMiOnsiZGF0YSI6NzMyOCwicHVyIjoiYmxvYl9pZCJ9fQ==--325027b761792e2e59bbe4419da68cfcc10dad65/detailed_flow_diagram.jpg	Web App	2025-07-10 11:26:02.706	https://drive.google.com/file/d/1hm8cBVmFnxON4KoEWT6lisTBQvBo0Gna/view?usp=sharing	2025-06-24 07:00:20.712	2025-07-02 22:56:03.048	https://raw.githubusercontent.com/Arbind007/OktaRoleMiningOpa/docs/README.md	https://github.com/Arbind007/OktaRoleMiningOpa	U092RTUP31Q	2025-07-10 11:55:47.105
