2063	Filter	Karman Chhatwal	/projects/2927	Perhaps the simplest way to represent an image is with a grid of pixels (i.e., dots), each of which can be of a different color. For black-and-white images, we thus need 1 bit per pixel, as 0 could represent black and 1 could represent white.\n\nIn this sense, then, is an image just a bitmap (i.e., a map of bits). For more colorful images, you simply need more bits per pixel. A file format (like BMP, JPEG, or PNG) that supports “24-bit color” uses 24 bits per pixel. (BMP actually supports 1-, 4-, 8-, 16-, 24-, and 32-bit color.)\n\nA 24-bit BMP uses 8 bits to signify the amount of red in a pixel’s color, 8 bits to signify the amount of green in a pixel’s color, and 8 bits to signify the amount of blue in a pixel’s color. If you’ve ever heard of RGB color, well, there you have it: red, green, blue.\n\nIf the R, G, and B values of some pixel in a BMP are, say, 0xff, 0x00, and 0x00 in hexadecimal, that pixel is purely red, as 0xff (otherwise known as 255 in decimal) implies “a lot of red,” while 0x00 and 0x00 imply “no green” and “no blue,” respectively. In this problem, you’ll manipulate these R, G, and B values of individual pixels, ultimately creating your very own image filters.\n\nIn a file called helpers.c in a folder called filter-less, write a program to apply filters to BMPs.\n\nThis is a problem from CS50x, Problem Set 4.	173	2	/rails/active_storage/blobs/redirect/eyJfcmFpbHMiOnsiZGF0YSI6MTE4MzksInB1ciI6ImJsb2JfaWQifX0=--585ed65c58490f85e66273e952ac89dd569e2b58/image.png	Command Line Tool	2025-07-10 11:26:02.706		2025-06-22 17:33:16.8	2025-07-02 22:38:52.846	https://raw.githubusercontent.com/code50/120336831/main/filter-less/README.md	https://github.com/code50/120336831/tree/main/filter-less	U091PCWGNBX	2025-07-10 11:55:54.069
